 const Card = () => {
   return (
     <div>
     <img alt='robots' src='https://robohash.org/cool-robot-pic?200x200' />
     <div>
     <h2>Jane Doe</h2>
     <p>jane.doe@gmail.com</p>
     </div>
     </div>

   );
 }

 export default Card;
